import * as React from 'react';
import Header from '../../header/Header';

const About = () => {
    return(
        <div>
            <Header />
            <ul>
                <li>
                    Eryk Liszewski
                    <ul>
                        <li>
                            <a href="https://github.com/eliszewski">Link to github profile</a>
                        </li>
                    </ul>
                </li>
            </ul>
        </div>
    )
}

export default About;
